import Navbar from "./Navbar"
import About from "./About"
import Work from "./Work"
import Me from "./Me"
import Footer from "./Footer"
import React from "react";
import CookingApp from "./CookingApp"
const Main = () => {
  return (
    <div>
      <Navbar />
      <About />
      <Work />
      <Me />
      <Footer />
      <CookingApp />
    </div>
  );
};

export default Main;
